import { FaShoppingCart } from "react-icons/fa";

const Navbar = () => {
  return <div className="flex justify-center aling">
    <div>
      <img src="https://help4code.com/static/images/logo.png"  width={120}/>
    </div>
    <div>
      <p>Home</p>
      <FaShoppingCart />
    </div>
  </div>;
};

export default Navbar;
